window.bookSummaryJSON = "<p>Fifty-six hard years after the events of <i>The Machine Crusade</i>, after the death of Serena Butler, the bloodiest decades of the Jihad take place. The human worlds begin to hope that the end of the centuries-long conflict with the thinking machines is finally in sight.</p> <p>Unfortunately, Omnius has one last, deadly card to play. In a last-ditch effort to destroy humankind, virulent plagues are let loose throughout the galaxy, decimating the populations of whole planets. The war that has lasted many lifetimes will be decided in the apocalyptic Battle of Corrin.</p> <p>In the greatest battle of science fiction history, human and machine face off one last time....And on the desert planet of Arrakis, the legendary Fremen of Dune become the feared fighting force to be discovered by Paul Maud'Dib in Frank Herbert's classic, <i>Dune</i>.</p>"; 
